clear all;% Load data.X = load('s2.dat');X = X(:,[1 2]);% DBSCAN% initialize parameters ( you can change them to see the difference)eps = 3.7;minPts = 3;% 3.5, 6% 3.6, 3% 3.6, 4% initialize indices that contains the label/cluster info of every datapoint.labels = zeros(size(X,1), 1);% 0 - the datapoint hasn't been touched% -1 - the datapoint is considered as noise% any positive integer (e.g 1,2,3,4,...) cluster labelC = 1; % current cluster label starts with 1 % walk through all data points:[m, n] = size(X);for i = 1:m    if labels(i,1) ~= 0      continue;  else      hood = findNeighbors(X, i, eps);      if size(hood)(1,1) < minPts          labels(i,1) = -1;      else          labels = extendCluster(X, labels, i, hood, C, eps, minPts);          C = C + 1;      end  end  %iend% Plot%scatter(X(:,1),X(:,2),32,indices,'filled')scatter(X(:,1),X(:,2),32,labels,'filled')